import React, { useState } from 'react'

const Home = () => {
  function App(){

    let [Counter , setCounter] = useState[15]
  }
    let Counter = 15
    const addValue = () => {
        console.log("Clicked",Counter);
        Counter = Counter+1
        setCounter(Counter)
    }
    const removeValue = () => {
      console.log("Clicked", Counter);
      setCounter(Counter - 1); // Decrease the counter value
    };
  return (
    <div>
      <h1>hello vikalp</h1>
      <h2>Counter value:{Counter}</h2>
      <button
      onClick={addValue}
      >Add value</button>
      <br/>
      <button>Removevalue</button>
    </div>
  
  )
}
